import React, { Component } from 'react'
import rocketLogo from '../src/img/rocket-02.png';
export default class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <ul className="nav">
            <li className="nav__item"><a href="#" className="nav__link">Home</a></li>
            <li className="nav__item"><a href="#" className="nav__link">Contact</a></li>
            <li className="nav__item"><a href="#" className="nav__link">Send Feedback</a></li>
            <li className="nav__item"><a href="#" className="nav__link">Our Story</a></li>
        </ul>
            <img className="_logo" src={rocketLogo} alt="rocket logo"/>
      </div>
    )
  }
}
